INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES (1, 7, "青空の下で謁見", 91002, 8, "ペコリーヌとの出会い", 20063115, 2834, "フリーマーケット会場", 10118, 0, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 5118061, 40, 2);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES (1, 7, "未来の騎空団\nマスコット？", 91002, 8, "マホとの出会い", 20063115, 2835, "フリーマーケット会場", 10118, 0, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 5118062, 40, 2);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES (1, 7, "お嬢さまからの\n緊急依頼", 91002, 8, "アキノとの出会い", 20063115, 2837, "ランドソル市街地", 10118, 0, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 5118063, 40, 2);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES (1, 18, "黄金色の悩みごと", 91002, 8, "ジュンとの出会い", 20063115, 4108402, "フリーマーケット会場", 10118, 0, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 5118064, 40, 2);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES (1, 18, "白熱！　格闘大会！", 91002, 8, "カオリとの出会い", 20063115, 4107402, "フリーマーケット会場", 10118, 0, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 5118065, 40, 2);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES (1, 16, "祭り太鼓はオーエドの華", 91002, 8, "ニノンとの出会い", 20063115, 9000227, "オーエド町", 10118, 1, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 5118066, 40, 2);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES (1, 19, "人気者は遅れて\nやってくる", 91002, 8, "スズナとの出会い", 20063115, 2101181, "フリーマーケット会場", 10118, 0, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 5118067, 40, 3);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES (1, 18, "巫女・ミーツ・魔法少女", 91002, 8, "ナナカとの出会い", 20063115, 4109402, "ランドソル市街地", 10118, 0, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 5118068, 40, 3);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES (1, 18, "ネズ耳は二度なくなる", 91002, 8, "キャル＆コッコロとの出会い", 20063115, 4305402, "フリーマーケット会場", 10118, 0, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 5118069, 40, 3);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES (1, 18, "この出会いにカンパイ！", 91002, 8, "ユカリとの出会い", 20063115, 4101402, "ランドソル市街地", 10118, 0, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 5118070, 40, 3);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES (1, 18, "陰陽アンサンブル", 91002, 8, "アオイとの出会い", 20063115, 4106402, "ランドソル市街地", 10118, 0, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 5118071, 40, 3);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES (1, 7, "運試し十番勝負！", 91002, 8, "シノブとの出会い", 20063115, 2836, "フリーマーケット会場", 10118, 1, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 5118072, 40, 3);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES (0, 0, "彼女たちの新たな日常", 0, 0, "オープニング", 20063115, 0, 0, 10118, 0, 0, 5118600, 0, 1);
